import AccountNavbar from "../../../components/account/AccountNavbar/AccountNavbar";

import AccountSidebar from "../../../components/account/AccountSidebar/AccountSidebar";

import { useState } from "react";

import ".././Clients.css";

import "./GetOrders.css";

import BindingModal from "./BindingModal";

const GetOrders = () => {
  const [sidebar, showSidebar] = useState(false);

  const [bindModal, showBindModal] = useState(false);

  const handleShowBindModal = () => {
    showBindModal(!bindModal);
  };

  const handleShowSidebar = () => {
    showSidebar(!sidebar);
  };

  return (
    <>
      <AccountNavbar sidebar={sidebar} handleShowSidebar={handleShowSidebar} />
      <AccountSidebar sidebar={sidebar} />
      <div className="orders account">
        <p className="empty"></p>
        <p className="medium-header">GET ORDERS</p>
        <div className="container">
          <div className="table_wrapper">
            <table>
              <thead>
                <td>Topic,OrderId,CustomerId</td>
                <td>Paper Details</td>
                <td>Due Date</td>
                <td>Pages</td>
                <td>Bids</td>
              </thead>
              <tbody>
                <tr>
                  <td>
                    <p>antlr</p>
                    <p>Order ID:6801238</p>
                    <p>Customer:-7539037</p>
                    <p className="table-btn">Stem</p>
                  </td>
                  <td>
                    <p>Essay(Any Type)</p>
                    <p>Computer Science</p>
                    <p className="table-btn" onClick={handleShowBindModal}>
                      Bid per Order
                    </p>
                  </td>
                  <td>
                    <p>7 days left</p>
                    <p>05 Jul, 06AM</p>
                  </td>
                  <td></td>
                  <td>1</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
        <BindingModal
          handleShowBindModal={handleShowBindModal}
          bindModal={bindModal}
        />
      </div>
    </>
  );
};

export default GetOrders;
